import React, { useState, useEffect } from 'react';
import { bookingsAPI } from '../../services/api';

const AgentHistory = () => {
    const [bookings, setBookings] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        const fetchHistory = async () => {
            try {
                const data = await bookingsAPI.getMy();
                setBookings(data);
            } catch (err) {
                setError(err.message || 'Failed to fetch booking history');
            } finally {
                setLoading(false);
            }
        };
        fetchHistory();
    }, []);

    const getStatusBadge = (status) => {
        const badges = {
            'pending': 'bg-warning text-dark',
            'confirmed': 'bg-success',
            'cancelled': 'bg-danger',
            'paid': 'bg-info'
        };
        return <span className={`badge rounded-pill ${badges[status] || 'bg-secondary'}`}>{status.toUpperCase()}</span>;
    };

    if (loading) return <div className="text-center py-5"><div className="spinner-border text-primary" role="status"></div></div>;

    return (
        <div className="container-fluid p-0">
            {error && <div className="alert alert-danger">{error}</div>}

            <div className="card border-0 shadow-sm rounded-4">
                <div className="card-header bg-white border-bottom py-3 d-flex justify-content-between align-items-center">
                    <h5 className="fw-bold mb-0">Booking History</h5>
                    <div className="d-flex gap-2">
                        <select className="form-select form-select-sm rounded-pill px-3">
                            <option>All Types</option>
                            <option>Tours</option>
                            <option>Hotels</option>
                            <option>Flights</option>
                        </select>
                        <button className="btn btn-outline-primary btn-sm rounded-pill px-3">
                            <i className="fa fa-download me-1"></i> Export
                        </button>
                    </div>
                </div>
                <div className="card-body p-0">
                    <div className="table-responsive">
                        <table className="table table-hover align-middle mb-0">
                            <thead className="bg-light">
                                <tr>
                                    <th className="ps-4 border-0">Booking ID</th>
                                    <th className="border-0">Service</th>
                                    <th className="border-0">Client Name</th>
                                    <th className="border-0">Date</th>
                                    <th className="border-0">Amount</th>
                                    <th className="border-0">Status</th>
                                    <th className="border-0 text-center">Actions</th>
                                </tr>
                            </thead>
                            <tbody>
                                {bookings.length === 0 ? (
                                    <tr>
                                        <td colSpan="7" className="text-center py-5 text-muted">
                                            <i className="fa fa-folder-open fs-1 opacity-25 d-block mb-3"></i>
                                            No bookings found in your history.
                                        </td>
                                    </tr>
                                ) : (
                                    bookings.map((booking, idx) => (
                                        <tr key={booking._id}>
                                            <td className="ps-4 fw-bold text-primary">#{booking._id.substring(18).toUpperCase()}</td>
                                            <td>
                                                <div className="d-flex align-items-center">
                                                    <div className="bg-light p-2 rounded i-2 me-3">
                                                        <i className="fa fa-map-marked-alt text-primary"></i>
                                                    </div>
                                                    <div>
                                                        <span className="d-block fw-bold small">{booking.tour?.title || 'Unknown Tour'}</span>
                                                        <span className="text-muted x-small">Tour Package</span>
                                                    </div>
                                                </div>
                                            </td>
                                            <td className="small">{booking.name}</td>
                                            <td className="small text-muted">{new Date(booking.createdAt).toLocaleDateString()}</td>
                                            <td className="fw-bold fw-primary">${booking.totalPrice || 0}</td>
                                            <td>{getStatusBadge(booking.status || 'pending')}</td>
                                            <td className="text-center">
                                                <button className="btn btn-sm btn-light border rounded-pill px-3 py-1">
                                                    View Details
                                                </button>
                                            </td>
                                        </tr>
                                    ))
                                )}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>

            <style>{`
                .x-small { font-size: 10px; }
                .fw-primary { color: #0d6efd; }
            `}</style>
        </div>
    );
};

export default AgentHistory;
